    def mousePressEvent(self, event):
        cell = self.childAt(event.pos())
        if self.selectedFig is None:
            self.selectedFig = cell

        else:
            self.selectedFig.move(cell.pos().x(), cell.pos().y())
            self.selectedFig = None





